import React from "react";
import UsersCatalog from "../components/UsersCatalog";

const Users = (props) => {
  const USERS = [
    {
      id: 1,
      name: "Jeff Tebang",
      image: "https://picsum.photos/200",
      post: 7,
    },
  ];

  return (
    <div>
      <UsersCatalog bits={USERS} />
    </div>
  );
};

export default Users;
